import React, { useState, useEffect } from 'react';
import './Pricing.css';

interface PricingPlan {
  id: number;
  title: string;
  price: number;
  description: string;
  featured?: boolean;
  details: string[];
}

const Pricing: React.FC = () => {
  const [selectedPlan, setSelectedPlan] = useState<PricingPlan | null>(null);

  const pricingPlans: PricingPlan[] = [
    {
      id: 1,
      title: 'Foto suelta',
      price: 15,
      description: 'Una imagen individual en alta calidad',
      details: [
        'Descarga inmediata',
        'Alta resolución (300 DPI)',
        'Sin marca de agua',
        'Formato JPG',
        'Válido para impresión',
      ],
    },
    {
      id: 2,
      title: 'Pack completo',
      price: 35,
      description: 'Todas las fotos de tu sesión, mismo día y persona',
      featured: true,
      details: [
        'Todas las fotos del día',
        'Descarga inmediata',
        'Alta resolución (300 DPI)',
        'Sin marca de agua',
        'Formato JPG',
        'Ahorra hasta 50%',
      ],
    },
    {
      id: 3,
      title: 'Día adicional',
      price: 20,
      description: 'Añade otro día a tu pack',
      details: [
        'Todas las fotos del día extra',
        'Mismo precio por día adicional',
        'Descarga inmediata',
        'Alta resolución',
        'Sin marca de agua',
      ],
    },
    {
      id: 4,
      title: 'Persona adicional',
      price: 20,
      description: 'Incluye otra persona en el mismo día',
      details: [
        'Fotos de otra persona',
        'Mismo día de sesión',
        'Descarga inmediata',
        'Alta resolución',
        'Sin marca de agua',
      ],
    },
  ];

  const openModal = (plan: PricingPlan) => {
    setSelectedPlan(plan);
  };

  const closeModal = () => {
    setSelectedPlan(null);
  };

  // Cerrar modal con tecla Escape
  useEffect(() => {
    const handleEscape = (e: KeyboardEvent) => {
      if (e.key === 'Escape') {
        closeModal();
      }
    };

    if (selectedPlan) {
      document.addEventListener('keydown', handleEscape);
      document.body.style.overflow = 'hidden';
    }

    return () => {
      document.removeEventListener('keydown', handleEscape);
      document.body.style.overflow = 'unset';
    };
  }, [selectedPlan]);

  return (
    <section className="pricing" id="pricing">
      <div className="pricing-wrapper">
        <div className="pricing-header">
          <h2 className="pricing-title">Precios</h2>
          <p className="pricing-subtitle">
            Elige la opción que mejor se adapte a ti
          </p>
        </div>

        <div className="pricing-grid">
          {pricingPlans.map((plan) => (
            <div 
              key={plan.id} 
              className={`pricing-card ${plan.featured ? 'featured' : ''}`}
              onClick={() => openModal(plan)}
            >
              <div className="pricing-card-content">
                <h3 className="pricing-card-title">{plan.title}</h3>

                <div className="pricing-card-price">
                  <span className="price-amount">{plan.price}</span>
                  <span className="price-currency">€</span>
                </div>

                <p className="pricing-card-description">{plan.description}</p>
              </div>
            </div>
          ))}
        </div>

        <div className="pricing-note">
          <p>Todos los precios incluyen descarga inmediata sin marca de agua</p>
        </div>
      </div>

      {/* Modal de detalles */}
      <div 
        className={`pricing-details-modal ${selectedPlan ? 'show' : ''}`}
        onClick={closeModal}
      >
        {selectedPlan && (
          <div 
            className="modal-content"
            onClick={(e) => e.stopPropagation()}
          >
            <div className="modal-header">
              <button 
                className="modal-close"
                onClick={closeModal}
                aria-label="Cerrar"
              >
                ×
              </button>
              <h3 className="modal-title">{selectedPlan.title}</h3>
              <div className="modal-price">
                <span className="modal-price-amount">{selectedPlan.price}</span>
                <span className="modal-price-currency">€</span>
              </div>
            </div>

            <div className="modal-body">
              <p className="modal-description">{selectedPlan.description}</p>

              <ul className="modal-details-list">
                {selectedPlan.details.map((detail, index) => (
                  <li key={index} className="modal-detail-item">
                    <div className="modal-detail-icon"></div>
                    <span className="modal-detail-text">{detail}</span>
                  </li>
                ))}
              </ul>
            </div>
          </div>
        )}
      </div>
    </section>
  );
};

export default Pricing;
